import {makeStyles} from '@material-ui/core/styles'


export const useStyles = makeStyles((theme) => ({
    root: {
        marginTop: '10px',
    },
    bottomHeader: {
        [theme.breakpoints.down('sm')]: {
            marginTop: '60px'
        }
    },
    modalDialog: {
        '& > div:first-child': {
            [theme.breakpoints.down('sm')]: {
                background: `linear-gradient(49.94deg, #675EAA 19.03%, #AD66D5 72.72%)!important`
            }
        }
    }
}))
